xquery version '1.0-ml';
        import module namespace admin='http://marklogic.com/xdmp/admin' at '/MarkLogic/admin.xqy';

        let $config := admin:get-configuration()
        let $db-name := 'msoff-conv-ent-alert-1'
        let $db-id := admin:database-get-id($config, $db-name)
        let $forest-id := admin:forest-get-id($config, $db-name)
        let $forest-config := admin:database-detach-forest($config, $db-id, $forest-id)
        return
          if (($forest-id = admin:database-get-attached-forests($forest-config, $db-id)))
          then fn:concat('Error: database-detach-forest ', admin:database-get-attached-forests($forest-config, $db-id))
          else admin:save-configuration($forest-config)
